import React from 'react';
import 'onsenui/css/onsenui.css';
import 'onsenui/css/onsen-css-components.css';
import TabBar from './Element/TabBar';
import {
  Route,
  Switch,
  Redirect,
  withRouter
} from "react-router-dom"


var Ons = require('onsenui');
var ROns = require('react-onsenui');

class Base extends React.Component {

    renderPage(route, navigator) {
      const props = route.props || {};
      props.navigator = navigator;

      const { history } = this.props

      return (
        <Route history={history} path={props.path} component={React.createElement(route.component, props)} />
        );
    }
    
    render() {
      return (
        <ROns.Navigator
        initialRoute={{component: TabBar, props: {key: 'main', path:'/'}}}
        renderPage={this.renderPage.bind(this)}>
        </ROns.Navigator>);
    }
}


export default Base;
